import React, { useState, useEffect } from "react";
import "./Dashboard.css";

function Dashboard() {
  const [devices, setDevices] = useState([]);

  useEffect(() => {
    fetch("/devices")
      .then((res) => {
        if (!res.ok) {
          throw new Error(`HTTP error ${res.status}`);
        }
        return res.json();
      })
      .then((data) => setDevices(data))
      .catch((err) => console.error("Error fetching devices:", err));
  }, []);

  return (
    <div className="dashboard-page">
      <h1>Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Sensor List</th>
          </tr>
        </thead>
        <tbody>
          {devices.map((device) => (
            <tr key={device._id}>
              <td>{device.Name}</td>
              <td>{device.SensorList}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export { Dashboard };
